import React, { Component } from 'react'
import { ListaTodo } from './ListaTodo';

export class App extends Component {
    todos = [
        {
            id: '1',
            title: 'Capacitação PET',
            completed: false
        },
        {
            id: '2',
            title: 'Comer Bolo',
            completed: false
        },
        {
            id: '3',
            title: 'Tomar refri',
            completed: false
        }
    ];
    render() {
    return (   
        <div>
          <ListaTodo todos={this.todos} marcarCheckBox={this.marcarCheckBox}/>
        </div>
    )
  }
}

export default App
